import Header from "./components/Header";
import { Routes, Route } from 'react-router-dom'
import Blogs from "./pages/Blogs";

function App() {
  return (
    <Routes>
      <Header />
      <Route path="/" element={Blogs} />
    </Routes>
  );
}

export default App;
